import React, { useRef } from 'react';

function HeaderNike(props){
  let nav = useRef(null)

  return(
    <header className="container-fluid">
    <div className="container">
      <div className="row">
        <div className="logo">
          <img src="_images_nike/nike_icon.jpg" height="48" alt="logo"/>
        </div>
        <nav ref={nav}>
          <a href="#">עמוד בית</a>
          <a href="#">אודות</a>
          <a href="#">גלריה</a>
          <a href="#">צור קשר</a>
        </nav>
        <div className="burger" onClick={() => {
          if(nav.current.style.display != "block"){
            nav.current.style.display = "block"
          }
          else{
            nav.current.style.display = "none"
          }
          
        }}>
          <i className="fa fa-bars" ></i>
        </div>
      </div>
    </div>
  </header>
  )
}

export default HeaderNike
